import React from "react";
import { useState } from "react";

export const AgeCounter = ({cat}) => {
  const [count, setCount] = useState(0);

  function incrementCount() {
    setCount(count + 1);
  }
  function setLife() {
    setCount(0);
  }

  return (
    <div className="AgeCounter">
      <h3> Age count is {count} </h3>
      <button onClick={incrementCount}>Increment count</button>
      <input type="text" onClick={(event) => setCount(event.target.value)} />
      <button onClick={setLife}>set life</button>
      {/* <input type="text" onClick={(event) => setLife(event.target.value)} /> */}
    </div>
  );
};
export default AgeCounter;
